import React from "react";
import { Link } from "react-router-dom";
import SearchBar from "../SearchBar/SearchBar"

class Nav extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div>
                <SearchBar/>
            </div>
        );
    };
};


export default Nav;
